import React, { useState, useEffect } from 'react'

export const GiftGrid = ( { category } ) => {

    const [images, setImages] = useState([]);

    useEffect( () => {
        getGifs();
    }, []);

    const getGifs = async () => {

        const url = 'https://api.giphy.com/v1/gifs/search?api_key=VujiwCJwCaWEMe8NsysofhmO6v3blL7U&q=Rick and Morty&limit=10';
        const respuesta = await fetch( url );
        const { data } = await respuesta.json();


        const gifs = data.map( img => {
            return {
                id : img.id,
                title: img.title,
                url: img.images?.downsized_medium.url
            }
        });

        console.log(gifs);
        setImages( gifs );

    }

    // getGifs();

    return (
        <div>
            <h3>{ category }</h3>

                { images.map ( ( {id, title}) => (

                    <li key={id} >{ title }</li>
                ))}

        </div>
    )
}
